properties.description:
Immobiliare Freedom propone in vendita, a due passi dalla fermata della metro maciachini, un'intero stabile di circa 680 mq complessivi accesso da via Carlo Imbonati e da via Bracco tramite il laboratorio, suddiviso in tre piani:
- piano terra di 335 mq circa composto da un laboratorio di 205 mq, un secondo laboratorio di 70 mq e tre box auto di 20 mq ognuno;
- piano primo di 146 mq totali diviso in due appartamenti uno di 60 mq con terrazzo di 32 mq e uno di 70 mq con terrazzo di 20 mq;
- piano s1 di 157 mq composto da locale cantine;
- piazzale esterno di 150 mq circa con 3 posti auto;
- solai al piano secondo.
I due appartamenti, un laboratorio, un box e una cantina sono attualmente locati.Per informazioni contattare i numeri: 0246514119, 3922496181 oppure via mail: milano@immobiliarefr
